import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Category = () => {
  const [categories, setCategories] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchCategories();
  }, []);

  const fetchCategories = async () => {
    // try {
    //   const response = await fetch("http://172.22.9.88:9966/mm/getcategory");
    //   const apiResponse = await response.json();
    //   const formattedCategories = apiResponse.data.map((category) => ({
    //     categoryId: category.categoryId,
    //     categoryName: category.categoryName || "N/A",
    //     categoryUrl: category.categoryUrl || "N/A",
    //     categoryCode: category.categoryCode || "N/A",
    //     language: category.language || "N/A",
    //     categoryType: category.categoryType || "N/A",
    //     categoryQuery: category.categoryQuery || "N/A",
    //     homeViewType: category.homeViewType || "N/A",
    //     categoryGroupId: category.categoryGroupId || "N/A",
    //     status: category.status === 0 ? "Pending" : "Published",
    //   }));
    //   setCategories(formattedCategories);
    // } catch (error) {
    //   console.error("Error fetching categories:", error);
    // }
  };

  const redirectToAdds = () => {
    navigate("/addcategory");
  };

  return (
    <div className="container-fluid">
      <div className="row">
        <div className="d-flex justify-content-between mt-5 px-4">
          <h4>Category</h4>
          <button className="btn btn-info text-light" onClick={redirectToAdds}>
            Add Category
          </button>
        </div>
        <div className="content-page">
          <div className="content">
            <div className="container-fluid">
              <div className="page-title-box pt-2">
                {/* Optional: Add page title and buttons */}
              </div>
              <div className="row">
                <div className="col-12">
                  <div className="card">
                    <div className="card-body">
                      <table className="table table-bordered">
                        <thead>
                          <tr>
                            <th>Category ID</th>
                            <th>Category Name</th>

                            <th>Category Code</th>
                            <th>Language</th>
                            <th>Category Type</th>

                            <th>Home View Type</th>
                            <th>Category Group ID</th>
                            <th>Status</th>
                          </tr>
                        </thead>
                        <tbody>
                          {categories.map((category) => (
                            <tr key={category.categoryId}>
                              <td>{category.categoryId}</td>
                              <td>{category.categoryName}</td>

                              <td>{category.categoryCode}</td>
                              <td>
                                {category.language == "1"
                                  ? "English"
                                  : " " || category.language == "2"
                                  ? "Hindi"
                                  : "" || category.language == "3"
                                  ? "Telugu"
                                  : ""}
                              </td>
                              <td>{category.categoryType}</td>

                              <td>{category.homeViewType}</td>
                              <td>{category.categoryGroupId}</td>
                              <td>
                                <div
                                  className={`badge ${
                                    category.status === "0"
                                      ? "bg-success"
                                      : "bg-danger"
                                  }`}
                                >
                                  {category.status}
                                </div>
                              </td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Category;
